import './PanelDropdown.css';
import Checkbox from '../common/Checkbox';
import React from 'react'

class PanelDropdown1 extends React.Component
{

  State = {
    checkedStatuses: {
      "новый": false,
      "расчет": false,
      "подтвержден": false,
      "выполнен": false,
      "отменен": false,
      "отложен": false,
    }
  }

  render()
  {

    const Status = [
      "новый",
      "расчет",
      "подтвержден",
      "выполнен",
      "отменен",
      "отложен",
    ];

    const DropdownData = Status.map((label) => {
      return (
        <li className="dropdown__option">
            <Checkbox
              label={label}
              name={label}
            ></Checkbox>
        </li>
      );
    });

    return(
      <div className="dropdown">
      <ul className="dropdown__list">{DropdownData}</ul>
    </div>
    );
  }
}

export default PanelDropdown1;
